import "../coinPage.css";
import React, { Component } from "react";

class ind extends Component {


  render() {
    return (
      <div className="indivcoin">
        <p>(icon) Bitcion BTC</p>
        <p>Time</p>
        <p>Latest Price:</p>
        <p>$4000 change</p>
        <p>1 BTC</p>
        <p>MarketCap:</p>
        <p>(24h)Volume:</p>
        <p>Current Supply:</p>
        <p>Total Supply:</p>
      </div>
    );
  }
}

export default ind;
